import React from 'react';
import Event from './components/Event';
import Header from './components/Header';
import './App.css';

function App() {
  return (
    <div className="App">
     <Header branding="Event Finder"/>
     <Event name="Event1" description="abc" location="loc1"/>
     <Event name="Event2" description="xyz" location="loc2"/>
     <Event name="Event3" description="pqr" location="loc3"/>
    </div>
  );
}

export default App;
